import React, { useState, useEffect } from 'react';
import { Button, Dropdown, DropdownButton, Form, Nav, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import axios from 'axios';

const NavbarProfile = (user) => {
  return (
    <Navbar>
      <Navbar.Brand href="#home">Welcome {user.fName}</Navbar.Brand>
      <Nav className="mr-auto"> </Nav>
      <Form inline>
        <Button className="mr-sm-2">Home</Button>
        <Nav.Link className="mr-sm-2">Services</Nav.Link>
        <Nav.Link className="mr-sm-2">Contact</Nav.Link>
        <DropdownButton className="mr-sm-2" id="dropdown-basic-button" title="Profile">
          <Dropdown.Item>View your Profile</Dropdown.Item>
          <Link tag="a" to="/add-worker" action><Dropdown.Item href="#/action-2">LogOut</Dropdown.Item></Link>
        </DropdownButton>
        <Link tag="a" to="/login" action><Button>Login</Button></Link>
      </Form>
    </Navbar>
  );
}

export default NavbarProfile;
